import React from 'react';

class Auth extends Component {
    render() {
        return (
            <div>
                <div className="row justify-content-center">
                    <h1>Effettua il login prima di entrare nell'area privata</h1>
                </div>
                <div className="row justify-content-center">
                    <form>
                        <div className="row">
                            <div class="input-group mb-3">
                                <input type="text" class="form-control w-100" placeholder="Username" aria-label="Username" aria-describedby="basic-addon1"></input>
                            </div>
                        </div>
                        <div className="row">
                            <div class="input-group mb-3">
                                <input type="password" class="form-control w-100" placeholder="Password" aria-label="Password" aria-describedby="basic-addon1"></input>
                            </div>
                        </div>
                    </form>
                </div>
            </div>
        );
    }

}

export default Auth;
